    private void SaveStorage() {
        storage.StorageId = $"{storage.WarehouseId}-{storage.ProductId}";
        if (!B_Storage.IsProductInWarehouse(storage.StorageId)) {
            storage.LastUpdate = DateTime.Now;
            B_Storage.CreateStorage(storage);
